column8:
・パイオニアのスピーカー取付キット、UD-K104です。<BR>
・車種はアストラ/ヴィータ/べクトラに対応いたします。<BR>
・スピーカーはトレードイン16cmに対応いたします。<BR>
・基本はパイオニアのスピーカー用ですが、他社製スピーカーでもトレードイン16cmであればほぼ対応できます。
<BR><BR>

<table width=600 border="2" bordercolor="blue" bgcolor="#99FFFF">
<td><center><font size=5><b>取付キット購入時のご注意</font></b><br></CENTER>
<br>
<font size=2>
・上記車種であっても、年式や仕様により対応しない場合もあります。<BR>
・適合につきましては、<BR>
　　車種<BR>
　　年式（○年○月）<BR>
　　純正のオーディオの仕様（スーパーライブか否かなど）<BR>
　　取付予定のスピーカー（商品型番、メーカー）<BR>
　をお書き添えの上、お問い合わせください。<BR><BR>
<B>お問い合わせ無しでご注文いただいた場合、適合間違いなどの理由があっても返品交換には一切応じられません。ご了承くださいませ。</B>
</font></td></table><style type="text/css">
